import { FETCH_PHARMACYS } from './types';

import axios from 'axios';

const url = 'https://jsonplaceholder.typicode.com/users';




export const fetchPharmacys = () => async dispatch => {
    const res = await axios.get(url)

    dispatch({ type: FETCH_PHARMACYS, payload: res.data });
}
